import Navbar from "../components/Navbar";
import AdminPanel from "../components/AdminPanel";
import AdminDashboard from "../components/AdminDashboard";

const Admin = () => {
  return (
    <>
      <Navbar />
      <AdminPanel />
      <AdminDashboard />
    </>
  );
};

export default Admin;
